// Solution 1:
const reorder = (arr) => {
    let aCount = 0;
    for(let i=0; i<arr.length; i++){
        if(arr[i] === "a"){
            aCount++;
        } else {
            arr.splice(i, 1);
            i--;
        }
    }
    while(aCount > 0){
        arr.unshift("a");
        aCount--;
    }
    return arr;
}

